import React from 'react';

const UserCard = props => {
    return (
        <div className='userCard'>
            <p>{props.gitHubUserContent.bio}</p>
            <p>{props.gitHubUserContent.bio}</p>
            <p>{props.gitHubUserContent.bio}</p>
            <p>{props.gitHubUserContent.bio}</p>
            <p>{props.gitHubUserContent.bio}</p>
        </div>
    )
}

export default UserCard;


